  get title() {
    const {statusCode} = this.props

    switch (statusCode) {
      case 404:
        return 'Opssss… Não encontramos a página'
      default:
        return 'Opssss… Ocorreu um erro no site!'
    }
  }

  get message() {
    const {statusCode} = this.props

    switch (statusCode) {
      case 404:
        return 'Não se preocupe, você pode voltar para a página anterior ou ir para a nossa Página Inicial. Pode também entrar em contato conosco!'
      default:
        return 'Ocorreu um erro no site e sua página não pôde ser exibida. Nossa equipe já está trabalhando nisso. Dentro de alguns instantes estaremos de volta.'
    }
  }

  get button() {
    const {statusCode} = this.props

    switch (statusCode) {
      case 404:
        return 'Ir para página inicial'
      default:
        return 'Ir para página inicial'
    }
  }

