  get url() {
    return `https://www.emcasa.com${this.props.asPath}`
  }

  get canonical() {
    return `https://www.emcasa.com/404`
  }

  render() {
    const {statusCode} = this.props

    return (
      <>
        <NextHead
          title={`${this.title} | EmCasa`}
          description={this.message}
          imageSrc={imageUrl('buy')}
          imageWidth={'1024'}
          imageHeight={'768'}
          url={this.url}
          canonical={this.canonical}
        />
        <Col px={4} mt={statusCode === 404 ? null : HEADER_HEIGHT}>
          <Row justifyContent="center">
            <Col width={[1,null,null,HTTPMessageSvgWidth]}>
              <Text
                fontSize={4}
                fontWeight="bold"
                textAlign="center"
              >{this.title}</Text>
              <Text
                textAlign="center"
                color="grey"
              >
                {this.message}
              </Text>
              {this.asset && (
                <Asset justifyContent="center">
                  {this.asset}
                </Asset>
              )}
              <Row justifyContent="center">
                <Col width={[1,null,null,1/2]} mt={4}>
                  <Link
                    passHref
                    href={this.href}
                  >
                    <a>
                      <Button
                        fluid
                        active
                        height="tall"
                      >
                        {this.button}
                      </Button>
                    </a>
                  </Link>
                  <View mt={3} mb="40px">
                    <Button fluid height="tall" onClick={() => window.history.back()}>
                      Voltar
                    </Button>
                  </View>
                </Col>
              </Row>
            </Col>
          </Row>
        </Col>
      </>
    )
  }
